function rgb2hsl(rgb){
    var r1 = rgb.r / 255;
    var g1 = rgb.g / 255;
    var b1 = rgb.b / 255;
 
    var maxColor = Math.max(r1,g1,b1);
    var minColor = Math.min(r1,g1,b1);
    //Calculate L:
    var L = (maxColor + minColor) / 2 ;
    var S = 0;
    var H = 0;
    if(maxColor != minColor){
        //Calculate S:
        if(L < 0.5){
            S = (maxColor - minColor) / (maxColor + minColor);
        }else{
            S = (maxColor - minColor) / (2.0 - maxColor - minColor);
        }
        //Calculate H:
        if(r1 == maxColor){
            H = (g1-b1) / (maxColor - minColor);
        }else if(g1 == maxColor){
            H = 2.0 + (b1 - r1) / (maxColor - minColor);
        }else{
            H = 4.0 + (r1 - g1) / (maxColor - minColor);
        }
    }
 
    L = L * 100;
    S = S * 100;
    H = H * 60;
    if(H<0){
        H += 360;
    }
  
    return {H, S, L};
}

function hexToRgb(hex) {
  var result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
  return result ? {
    r: parseInt(result[1], 16),
    g: parseInt(result[2], 16),
    b: parseInt(result[3], 16)
  } : null;
}

function getNearestColour(valueInHex) {
  const { r, g, b } = hexToRgb(valueInHex);
  
  let nearest = null;
  for (let pant of pantone) {

    var diffR = Math.abs(r - pant.rgb.r);
    var diffG = Math.abs(g - pant.rgb.g);
    var diffB = Math.abs(b - pant.rgb.b);

    var totalDiff = diffR + diffG + diffB;
    
    if (nearest === null) {
      nearest = { distance: totalDiff, pant };
    } else if (totalDiff < nearest.distance) {
      nearest = { distance: totalDiff, pant };      
    }
  }
  
  return nearest.pant;  
}
